12432	\N	Lessons are often theory-based, and sometimes we end up copying code directly from presentations. I feel this approach is not always the most effective for students, because sometimes we manage to copy it on time, and sometimes we do not. Additionally, our code submissions rarely receive feedback. While explaining topics, there is often too much information, which can make students feel overwhelmed or confused. Real-life examples are very helpful, but having too many for a single concept can be excessive.\r\n\r\nExams also appear to be designed in a way that can be discouraging rather than encouraging free thinking. When students try to justify their answers, it can be perceived negatively. The current focus seems more on memorization than on actual coding or problem-solving skills. It is unclear why students are required to memorize code and algorithms instead of understanding the concepts and applying their own methods. There are no preparatory sessions before exams, yet they cover a large amount of material, and marking does not always feel fair.\r\n\r\nWhen students attempt to provide feedback, comments like you are teaching the teacher how to teach are sometimes made. I believe students understanding and feedback should be considered as part of the teaching process. I would also suggest setting some standards for how exams are prepared, as some question formats are difficult to interpret, which affected my midterm grades.\r\n\r\nAll students should be treated equally. Comments such as you are weak or you are strong made publicly can make students, especially girls, uncomfortable and discouraged. Issues regarding a students behavior should be addressed directly with the student rather than ignored and later reported to the education department. If parents are invited to a meeting, the teacher should interact with them respectfully rather than making them wait unnecessarily. A lack of welcome or proper interaction feels disrespectful to both students and parents.\r\n\r\nDuring the internship, CS-24 was divided into four groups, and the prize was meant to be awarded to the best group. However, four students were chosen from each group and presented as the strongest team, rather than acknowledging the actual winning group. This approach felt demotivating to students.\r\n\r\nFrom this feedback, I hope you can understand my perspective. I have refrained from reporting these issues to the education department for a long time, out of consideration for the professor being away from his city and family, and also out of respect for him. My one small disagreement with a professor was immediately reported, while I stayed silent on other matters out of respect. Not being heard and having assumptions made about me caused frustration.\r\n\r\nIt is possible that some students may not understand certain topics or fail subjects, but they should not be judged without understanding the reasons behind it. Some students may have lower marks but a better grasp of the material than others. It is important to understand why students may disagree with specific teachers rather than generalizing to all teachers.\r\n\r\nI sincerely hope this feedback will be considered. My intention is not to speak negatively about any professor, but rather to foster a supportive and respectful learning environment. I chose this international university to gain knowledge from international educators, and I hope the treatment I receive reflects the standards of such an environment, especially considering that I earned a full scholarship.	2025-12-02 06:32:54.582058+00	21	592
