21735	\N	the course itself, in my opinion, is very ineffective. First of all, because we lack the practice of speaking uzbek (most of the times, it is a lecture by the professor, so we stay silent and listen to the professor speak). However, in the beginning of the semester we were told that it will fully be "practising speaking uzbek" course. In reality, it is absolutely different. Listening would not help us learn the language at all, we need practice. On top of that, professor fully speaks uzbek and rarely uses other languages and because it is a "beginner group" most of the students do not understand what professor is talking about and get demotivated to keep studying. Secondly, for a beginner group, there must be lessons of useful vocabulary and grammar. Because not only students cannot use the appropriate words to express their thoughts, but even if they did know the words, they would not also succeed in applying them because they do not know the correct ways of connecting them (grammar). Thirdly, some topics that we study focus on specific areas, such as uzbek weddings, uzbek art and so on. From my perspective, we should start from more general topics. Therefore, due to level of knowledge of uzbek language being very low in our group, we need an easier and more interactive course to truly enhance our knowledge. Thank you in advance for considering our feedback!	2025-12-02 13:24:36.749847+00	21	1035
